import React, { Fragment, useState } from "react";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import TextField from "@material-ui/core/TextField";
import Divider from "@material-ui/core/Divider";
import Phone from "material-ui-phone-number";
import InputLabel from "@material-ui/core/InputLabel";
import MenuItem from "@material-ui/core/MenuItem";
import FormControl from "@material-ui/core/FormControl";
import Select from "@material-ui/core/Select";
import Input from "@material-ui/core/Input";
import Button from "@material-ui/core/Button";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogTitle from "@material-ui/core/DialogTitle";

export default function PrepareCV() {
  const [phone, setPhone] = useState();
  const [title, setTitle] = useState();
  const [open, setOpen] = React.useState(false);
  const [birthday, setBirthday] = useState({
    day: "",
    month: "",
    year: "",
  });
  const [birthdayButton, setBirthdayButton] = useState(
    "Click to select date of birth"
  );
  var days = Array(31)
    .fill()
    .map((_, i) => i + 1);
  var months = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December",
  ];
  var years = Array(101)
    .fill()
    .map((_, i) => i + 1920);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  return (
    <div>
      <Paper elevation={2}>
        <Typography variant="h5" component="h2">
          Personal Information
        </Typography>
        <Divider variant="middle" />
        <form>
          <TextField
            value={title}
            label="Title"
            onChange={(title) => setTitle(title)}
          ></TextField>
          <Phone
            label="Phone Number"
            defaultCountry={"tr"}
            onChange={(phone) => setPhone(phone)}
          />
          <div>
            <Button onClick={handleClickOpen}>{birthdayButton}</Button>
            <Dialog
              disableBackdropClick
              disableEscapeKeyDown
              open={open}
              onClose={handleClose}
            >
              <DialogTitle>Fill the form</DialogTitle>
              <DialogContent>
                <form>
                  <FormControl>
                    <InputLabel htmlFor="demo-dialog-native">Day</InputLabel>
                    <Select
                      native
                      value={birthday.day}
                      onChange={(day) =>
                        setBirthday({
                          ...birthday,
                          day: day,
                        })
                      }
                      input={<Input id="demo-dialog-native" />}
                    >
                      <option aria-label="None" value="" />
                      <option value={10}>Ten</option>
                      <option value={20}>Twenty</option>
                      <option value={30}>Thirty</option>
                    </Select>
                  </FormControl>
                  <FormControl>
                    <InputLabel id="demo-dialog-select-label">Month</InputLabel>
                    <Select
                      labelId="demo-dialog-select-label"
                      id="demo-dialog-select"
                      value={birthday.month}
                      onChange={(month) =>
                        setBirthday({
                          ...birthday,
                          month: month,
                        })
                      }
                      input={<Input />}
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      <MenuItem value={10}>Ten</MenuItem>
                      <MenuItem value={20}>Twenty</MenuItem>
                      <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
                  </FormControl>
                  <FormControl>
                    <InputLabel id="demo-dialog-select-label">Year</InputLabel>
                    <Select
                      labelId="demo-dialog-select-label"
                      id="demo-dialog-select"
                      value={birthday.year}
                      onChange={(year) =>
                        setBirthday({
                          ...birthday,
                          year: year,
                        })
                      }
                      input={<Input />}
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      <MenuItem value={10}>Ten</MenuItem>
                      <MenuItem value={20}>Twenty</MenuItem>
                      <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
                  </FormControl>
                </form>
              </DialogContent>
              <DialogActions>
                <Button onClick={handleClose} color="primary">
                  Cancel
                </Button>
                <Button onClick={handleClose} color="primary">
                  Ok
                </Button>
              </DialogActions>
            </Dialog>
          </div>
        </form>
      </Paper>
    </div>
  );
}
